var submitted=!1;const queryString=window.location.search,urlParams=new URLSearchParams(queryString),subscribed=urlParams.get("subscribed");if("true"==subscribed){var element=document.getElementById("email-subscribed");element.classList.add("d-block")}const navbar=document.querySelector(".navbar");window.onscroll=()=>{window.scrollY>20?(navbar.classList.add("scrolled"),navbar.classList.add("fixed-top")):(navbar.classList.remove("scrolled"),navbar.classList.remove("fixed-top"))};